import React from 'react';
import NavBar from '../Navbar/NavBar';


export default function  DashBoard (){
    return(
        <>
            <NavBar/>
            <div className="dashBoardcontainer">
                <div className="myProfile">
                    My Profile
                </div>

                <div className="myProfileImg">
                    My Profile
                </div>



            </div>
        </>

    )
}
